const apiPath = '/api/v1';

export default {
  loginPath: () => [apiPath, 'login'].join('/'),
  usersPath: () => [apiPath, 'data'].join('/'),
  createUserPath: () => [apiPath, 'signup'].join('/'),
  login: '/login',
  chat: '/',
  notFound: '*',
  signup: '/signup',
};
